import React, { useState } from "react";

const Form = () => {
  const calculateHandler = (event, userInput) => {
    // Prevent the default form submission behavior
    event.preventDefault();

    // Should be triggered when form is submitted

    const yearlyData = []; // per-year results
    let currentSavings = +userInput["enteredCurrentSavings"];
    const yearlyContribution = +userInput["enteredYearlySavings"];
    const expectedReturn = +userInput["enteredExpectedInterest"] / 100;
    const duration = +userInput["enteredInvestmentDuration"];

    // The below code calculates yearly results (total savings, interest etc)
    for (let i = 0; i < duration; i++) {
      const yearlyInterest = currentSavings * expectedReturn;
      currentSavings += yearlyInterest + yearlyContribution;
      yearlyData.push({
        year: i + 1,
        yearlyInterest: yearlyInterest,
        savingsEndOfYear: currentSavings,
        yearlyContribution: yearlyContribution,
        investedCapital: currentSavings - yearlyInterest,
      });
      console.log(yearlyData);
    }

    // do something with yearlyData ...
  };

  const [userInput, setUserInput] = useState({
    enteredCurrentSavings: "",
    enteredYearlySavings: "",
    enteredExpectedInterest: "",
    enteredInvestmentDuration: "",
  });

  const CurrentSavingsChangeHandler = (event) => {
    const newValue = event.target.value;

    setUserInput((prevState) => {
      return {
        ...prevState,
        enteredCurrentSavings: newValue !== "" ? parseInt(newValue, 10) : "",
      };
    });
  };

  const YearlySavingsChangeHandler = (event) => {
    const newValue = event.target.value;

    setUserInput((prevState) => {
      return {
        ...prevState,
        enteredYearlySavings: newValue !== "" ? parseInt(newValue, 10) : "",
      };
    });
  };

  const ExpectedInterestChangeHandler = (event) => {
    const newValue = event.target.value;

    setUserInput((prevState) => {
      return {
        ...prevState,
        enteredExpectedInterest: newValue !== "" ? parseInt(newValue, 10) : "",
      };
    });
  };

  const InvestmentDurationChangeHandler = (event) => {
    const newValue = event.target.value;

    setUserInput((prevState) => {
      return {
        ...prevState,
        enteredInvestmentDuration:
          newValue !== "" ? parseInt(newValue, 10) : "",
      };
    });
  };

  return (
    <form
      className="form"
      onSubmit={(event) => calculateHandler(event, userInput)}
    >
      <div className="input-group">
        <p>
          <label htmlFor="current-savings">Current Savings ($)</label>
          <input
            type="number"
            id="current-savings"
            value={userInput["enteredCurrentSavings"]}
            onChange={CurrentSavingsChangeHandler}
          />
        </p>
        <p>
          <label htmlFor="yearly-contribution">Yearly Savings ($)</label>
          <input
            type="number"
            id="yearly-contribution"
            value={userInput["enteredYearlySavings"]} //two-way binding
            onChange={YearlySavingsChangeHandler}
          />
        </p>
      </div>
      <div className="input-group">
        <p>
          <label htmlFor="expected-return">
            Expected Interest (%, per year)
          </label>
          <input
            type="number"
            id="expected-return"
            min=''
            value={userInput["enteredExpectedInterest"]}
            onChange={ExpectedInterestChangeHandler}
          />
        </p>
        <p>
          <label htmlFor="duration">Investment Duration (years)</label>
          <input
            type="number"
            id="duration"
            value={userInput["enteredInvestmentDuration"]}
            onChange={InvestmentDurationChangeHandler}
          />
        </p>
      </div>
      <p className="actions">
        <button type="reset" className="buttonAlt">
          Reset
        </button>
        <button type="submit" className="button">
          Calculate
        </button>
      </p>
    </form>
  );
};
export default Form;
